	public static bool ExistsMsg(int _iMsgID)
	{
		int nCur = 0, nStart = 0, nEnd = 231 - 1, nDiff = 0;
		while (nStart <= nEnd)
		{
			nCur = (nStart + nEnd) >> 1;
			nDiff = s_arrMsgID[nCur] - _iMsgID;
			if (nDiff == 0) { return true; }
			if (nDiff < 0) { nStart = nCur + 1; } else { nEnd = nCur - 1; }
		}
		return false;
	}

